import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.css';

class Event extends Component {
    state = { 
        eventName: 'Trip',
        eventUser: { 
            photo: 'https://picsum.photos/75',
            nick: 'Lissa',    
            owesMe:100 ,
            oweTo:0 ,       

         }

     }
    render() { 
        return ( 
            <>
                <div>
                    <h1>{this.state.eventName}</h1>
                </div>
                <span>
                    <img src={this.state.eventUser.photo}></img>
                    <h2>{this.state.eventUser.nick}</h2>
                </span>             
                <div>
                    <h3>{this.state.eventUser.owesMe}</h3>
                    <h3>{this.state.eventUser.oweTo}</h3>
                </div>
            </>
         );
    }
}

export default Event;
